import React from "react";
import {
	Breadcrumb,
	BreadcrumbItem,
} from "reactstrap";
import { Link } from "react-router-dom";
import { withGoogleSheets } from 'react-db-google-sheets';

const SingleSheet = (props) => (
  <div>
  <table className="table">
    <thead>
      <tr>
        <th>id</th>
        <th>name</th>
        <th>email</th>
      </tr>
    </thead>
    <tbody>
      {props.db.samplesheet.map((data) => (
        <tr key={data.id}>
          <td>{data.id}</td>
          <td>{data.name}</td>
          <td>{data.email}</td>
        </tr>
      ))}
    </tbody>
  </table>
  <button className="btn btn-primary" onClick={props.refetch}>
      Refresh
    </button>
    </div>
);

// function LoadRoster () {
//   doc.useApiKey('AIzaSyBetrWCd01ato3MjH7cRSfnc-vecg56_os'); 
// }


function Roster(props) {
	return (
		<div className="container main">
			<div className="row">
				<div className="col">
					<Breadcrumb>
						<BreadcrumbItem>
							<Link to="/home">Home</Link>
						</BreadcrumbItem>
						<BreadcrumbItem active>Roster</BreadcrumbItem>
					</Breadcrumb>
					<h2>Roster</h2>
					<hr />
				</div>
			</div>
			<div className="row row-content">
				<div className="col">
					<iframe
						src="https://docs.google.com/spreadsheets/d/e/2PACX-1vTc9HqJUZICNSrn2U4htiQMjvg74fVznQ3pFqpGhUru1POKttCL1NLJJcXV7LbSG40RG-zTNO0-myed/pubhtml?gid=0&amp;single=true&amp;widget=true&amp;headers=false"
						width="100%"
						height="600px"
					></iframe>
				</div>
			</div>
		</div>
	);
}

export default withGoogleSheets('Activity')(Roster);
